import React from 'react';
import shoes from '../../Data/shoes.json'
import ProductItem from "./ProductItem";

function ProductList(props) {
    return (
        <div>{
            shoes.map((shoe) => {
                return (
                    <ProductItem item={shoe}/>
                )
            })
        }</div>
    );
}

export default ProductList;
